CREATE TABLE IF NOT EXISTS "games_archive" (
	"id"	INT,
	"date"	DATE NOT NULL,
	"opponent"	VARCHAR(255),
	"score total"	VARCHAR(255),
	"score set 1"	VARCHAR(255),
	"score set 2"	VARCHAR(255),
	"score set 3"	VARCHAR(255),
	"score set 4"	VARCHAR(255),
	"score set 5"	VARCHAR(255),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "active_game" (
	"number"	INT NOT NULL,
	"name"	VARCHAR(255) NOT NULL,
	"serves"	VARCHAR(255),
	"passes"	INT,
	"attacks"	VARCHAR(255),
	"assists"	VARCHAR(255),
	"set_id"	INT
);
CREATE TABLE IF NOT EXISTS "players" (
	"id"	INT,
	"game_id"	INT,
	"player_number"	INT,
	"player_name"	VARCHAR(255),
	"serves"	VARCHAR(255),
	"passes"	VARCHAR(255),
	"attacks"	VARCHAR(255),
	"assists"	VARCHAR(255),
	"set_id"	INT,
	FOREIGN KEY("game_id") REFERENCES "games_archive"("id"),
	PRIMARY KEY("id")
);
COMMIT;
